"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Poor weight gain in babies and children (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/poor-weight-gain-in-babies-and-children-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H476721256\">",
"      <span class=\"h1\">",
"       How do I know if my baby is not gaining enough weight?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse will tell you if your baby is not gaining enough weight. At each visit, he or she will weigh your baby. Then he or she will compare your baby&rsquo;s weight to the weight of other babies who are the same age and sex. Babies who weigh less than other babies of the same age and sex are not gaining enough weight.",
"     </p>",
"     <p>",
"      Some babies do not gain enough weight starting at birth. Other babies gain enough weight for a while, but then slow down or stop gaining weight.",
"     </p>",
"     <p>",
"      If your baby isn&rsquo;t gaining enough weight, your doctor or nurse will want to figure out why. He or she will treat the cause and work with you to help your baby gain more weight. Babies need to gain enough weight so that they can grow and develop normally. Babies who do not gain enough weight can have problems later in life, such as learning problems or problems with the body&rsquo;s infection-fighting system.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H476721263\">",
"      <span class=\"h1\">",
"       What are reasons that a baby might not gain enough weight?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Reasons that a baby might not gain enough weight can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Being born too early",
"       </li>",
"       <li>",
"        Not getting enough food &ndash; For example, some babies have trouble sucking at the breast or bottle. Or parents might not feed their baby often enough.",
"       </li>",
"       <li>",
"        Having a medical problem that affects the stomach, mouth, throat, or heart",
"       </li>",
"       <li>",
"        Changes or stress in the home or family",
"       </li>",
"       <li>",
"        Having things around that take attention away from eating",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H476721270\">",
"      <span class=\"h1\">",
"       How can my doctor figure out why my child isn&rsquo;t gaining weight?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse will do an exam and ask you questions about your child&rsquo;s eating habits. He or she might ask you to keep track of all the food that your child eats (",
"      <a class=\"graphic graphic_figure graphicRef58605 \" href=\"UTD.htm?26/37/27231\">",
"       figure 1",
"      </a>",
"      ). Let your doctor or nurse know if your child:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Has vomiting or diarrhea",
"       </li>",
"       <li>",
"        Does not eat certain foods",
"       </li>",
"       <li>",
"        Drinks much more than he or she eats",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Your doctor might also order a test.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H476721277\">",
"      <span class=\"h1\">",
"       Who do I work with to help my child gain weight?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse will work with you to make a plan to help your child to gain weight. He or she might recommend that you also work with other experts, such as a dietitian. A dietitian is an expert on food and eating.",
"     </p>",
"     <p>",
"      Most children can be treated at home. But some children need to stay in the hospital for a short time. In the hospital, doctors can treat children and watch them closely.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H476721284\">",
"      <span class=\"h1\">",
"       What can I do to help my child gain enough weight?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You can do different things to help your child gain enough weight (",
"      <a class=\"graphic graphic_table graphicRef52880 \" href=\"UTD.htm?0/2/36\">",
"       table 1",
"      </a>",
"      ). You can change:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        What your child eats &ndash; You can help your child gain weight by feeding him or her foods with a lot of calories. Talk with your doctor, nurse, or dietitian about the right way to do this. He or she might recommend that you add extra calories to your baby&rsquo;s feedings. Or you might need to add cheese, butter, or sour cream to foods that your older child eats. Your doctor or nurse might also recommend that your child take a vitamin every day.",
"       </li>",
"       <li>",
"        How often your child eats &ndash; Babies might need more feedings each day to gain weight. Older children might need to eat every 2 to 3 hours, and have 3 meals and 3 snacks a day.",
"       </li>",
"       <li>",
"        Where and how your child eats &ndash; Making changes to the area where your child eats might help your child eat more. For example, some children eat more when the whole family eats together or when meals are fun.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H476721291\">",
"      <span class=\"h1\">",
"       What other treatments might help my child gain enough weight?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Sometimes, other types of treatments can help. These can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medical treatments &ndash; Some children need to be treated for medical problems that can keep them from gaining enough weight.",
"       </li>",
"       <li>",
"        Physical or occupational therapy &ndash; Some children have problems with their body or behavior that can make it hard for them to eat enough food. People called &ldquo;physical therapists&rdquo; or &ldquo;occupational therapists&rdquo; can work with children to improve these types of problems.",
"       </li>",
"       <li>",
"        Family help &ndash; Some children do not eat enough because of problems at home. A family might not have enough food, or a parent might be too sick to take care of a child. Your doctor or nurse can work with you to find programs or people who can help with these types of problems.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H476721298\">",
"      <span class=\"h1\">",
"       When do I follow up with my doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse will follow-up with you on a regular basis. On each visit, he or she will weigh your baby and talk with you. Let your doctor or nurse know if you are having any problems with treatment.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H476721305\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
