"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Nasal calcitonin improves bone pain",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 401px; height: 272px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Effect of intranasal salmon calcitonin (sCT) or placebo on the intensity of spontaneous bone pain (score from 0 to 20) in women with recent osteoporotic spinal fractures. Salmon calcitonin led to a more rapid reduction in pain.",
"    <div class=\"footnotes\">",
